import React, { useState } from 'react';
import { View, FlatList, StyleSheet, Image, TouchableOpacity, Text } from 'react-native';
import CustomTextInput from '../components/CustomTextInput'; // Adjust the import path as necessary

interface Contact {
  id: string;
  name: string;
  status: string;
  lastSeen: string;
  online: boolean;
  avatar: string;
}

const contacts: Contact[] = [
  { id: '1', name: 'Athalia Putri', status: 'Last seen yesterday', lastSeen: 'yesterday', online: false, avatar: 'data:image/png;base64,' },
  { id: '2', name: 'Erlan Sadewa', status: 'Online', lastSeen: '', online: true, avatar: 'data:image/png;base64,' },
  { id: '3', name: 'Midala Huera', status: 'Last seen 3 hours ago', lastSeen: '3 hours ago', online: false, avatar: 'data:image/png;base64,' },
  { id: '4', name: 'Nafisa Gitari', status: 'Online', lastSeen: '', online: true, avatar: 'data:image/png;base64,' },
  { id: '5', name: 'Raki Devon', status: 'Online', lastSeen: '', online: true, avatar: 'data:image/png;base64,' },
  { id: '6', name: 'Salsabila Akira', status: 'Last seen 30 minutes ago', lastSeen: '30 minutes ago', online: false, avatar: 'data:image/png;base64,' },
];

const ContactsScreen: React.FC = () => {
  const [searchQuery, setSearchQuery] = useState<string>('');

  // Filter contacts based on search query
  const filteredContacts = contacts.filter(contact =>
    contact.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <View style={styles.container}>

      <Text style={{ color: '#FFFFFF', fontSize: 24, fontWeight: 'bold', marginVertical: 10 }} >
        Contacts
      </Text>
      {/* Search Input */}
      <CustomTextInput
        
        placeholder="Search by name..."
        value={searchQuery}
        onChangeText={setSearchQuery} // Update search query
        iconName="search-outline" // Optional: add an icon for search
      />

      {/* Contact List */}
      <FlatList
        data={filteredContacts}
        keyExtractor={(item) => item.id}
        renderItem={({ item }) => (
          <TouchableOpacity style={styles.contactItem}>
            <View style={styles.contactDetails}>
              <Image source={{ uri: item.avatar }} style={styles.avatar} />
              <View style={styles.textContainer}>
                <Text style={styles.contactName}>{item.name}</Text>
                <Text style={styles.contactStatus}>{item.status}</Text>
              </View>
            </View>
            {item.online && <View style={styles.onlineIndicator} />}
          </TouchableOpacity>
        )}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#0E1624',
    padding: 10,
  },
  contactItem: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 15,
    borderBottomWidth: 1,
    borderBottomColor: '#1F2C40',
    justifyContent: 'space-between',
  },
  contactDetails: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  avatar: {
    width: 50,
    height: 50,
    borderRadius: 25,
    marginRight: 15,
  },
  textContainer: {
    justifyContent: 'center',
  },
  contactName: {
    fontSize: 18,
    color: '#FFFFFF',
    fontWeight: 'bold',
  },
  contactStatus: {
    fontSize: 14,
    color: '#A0AABF',
  },
  onlineIndicator: {
    width: 12,
    height: 12,
    borderRadius: 6,
    backgroundColor: '#00FF00',
    position: 'absolute',
    right: 10,
  },
});

export default ContactsScreen;
